import maison1 from './assets/images/maison1.jpg';
import maison2 from './assets/images/maison2.jpg';
import maison3 from './assets/images/maison3.jpg';

function Pictures({pictures}) {
    return(
        <div>

            <div>
                <div>
                {pictures}
                <img src={maison1} alt="maison1"/>
                <img src={maison2} alt="maison2"/>
                <img src={maison3} alt="maison3"/>
                </div>
            </div>

        </div>
    )
}

export default Pictures;
